create table Users (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	ip_address VARCHAR(20),
	phone_number VARCHAR(50),
	is_admin VARCHAR(50),
	social_security_number VARCHAR(50),
	date_of_birth DATE
);
create table Bank_Accounts (
	id INT,
	bank_name VARCHAR(15),
	bank_checking_account DECIMAL(9,2),
	bank_savings_account DECIMAL(9,2),
	user_id INT,
	routing_number INT,
	override_authorization_code VARCHAR(4),
	total_amount_of_networth DECIMAL(10,2)
);
create table Organizations (
	ID INT,
	ORG_ID INT,
	NAME_EN VARCHAR(50),
	DESCRIPTION_EN TEXT,
	PARENT_ORG_ID INT,
	DIR_LVL_ID INT,
	LAST_UPDATED DATE,
	DELETED VARCHAR(50)
);

